import React from 'react';
import { Form, Button } from 'react-bootstrap';

const Login = () => {
    const handlerUserId =  ()=>{

    }
    const handlerEmail =()=>{

    }
    const handlerEmailAuth = ()=>{

    }
    const handlerEmailvaild = ()=>{

    }
    const handlerUserPw = ()=>{

    }
    const handleLogin = ()=>{

    }



  return (
    <div className="container-fluid">
    <div className="row justify-content-center mt-5">
      <div className="col-md-6 col-lg-4">
        <div className="card">
          <div className="card-body">
            <h5 className="card-title text-center mb-4">로그인</h5>
            <form>
              <div className="mb-3">
                <label htmlFor="userId" className="form-label">아이디:</label>
                <input
                  type="text"
                  id="userId"
                  name="userId"
                  className="form-control"
                  onChange={handlerUserId}
                  placeholder="아이디 입력"
                  required
                />
              </div>
              <div className="mb-3">
                <label htmlFor="userEmail" className="form-label">이메일:</label>
                <input
                  type="text"
                  id="userEmail"
                  name="userEmail"
                  className="form-control" 
                  onChange={handlerEmail}
                  placeholder="이메일 입력"
                  required
                />
                </div>
                <div className="input-group mb-3">
                <input 
                    type = 'text'
                    id = "emailAuth"
                    name = 'emailAuth'
                    onChange={handlerEmailvaild}
                    className="form-control" 
                    placeholder = "인증 번호 입력"
                    />
                  <button type="submit" onClick={handlerEmailAuth} className="btn btn-primary btn-block">인증</button>
                </div>

              <div className="mb-3">
                <label htmlFor="userPW" className="form-label">비밀번호:</label>
                <input
                  type="password"
                  id="userPW"
                  name="userPW"
                  className="form-control"
                  onChange={handlerUserPw}
                  placeholder="비밀번호 입력"
                  required
                />
              </div>
              <button type="submit" onClick={handleLogin} className="btn btn-primary btn-block">로그인</button>
            </form>
          </div>
        </div>
      </div>
    </div>
  </div>
  );
}

export default Login;
